import React, {Component} from 'react'
import CharityInfo from './components/CharityInfo'

class Main extends Component {
    constructor(props) {
        super(props)

    }

    componentDidMount() {
        this.props.socket.send()
    }


    render() {
        return (
            <div>
                <input type='text' placeholder='pesquisar'></input>
                <div>
                    <CharityInfo/>
                    <CharityInfo/>
                    <CharityInfo/>
                    <CharityInfo/>
                </div>
            </div>
        )
    }
}

export default Main
